$(document).ready(function(){$(".button-collapse").sideNav({edge:"right"});var a=$("#msgFlash");if(a.children("div").html().trim()!=""){a.fadeIn();setTimeout(function(){a.fadeOut()},3000)}$("#msgFlash").children("div").click(function(){a.fadeOut()});$("h1, h2, h3, h4, h5").keydown(function(){$(this).children("i").css({visibility:"visible"})});$(".editTitle").click(function(){var d=$(this);var c=d.parent().children("span").html();var b=d.parent().data("page");c=c?c:"Titre de page";d.parent().children("span").html(c);$.ajax({type:"POST",url:"ajax.php?ajax=editTitle",data:{page:b,title:c},success:function(f,g,e){if(f.trim()=="OK"){d.parent().children("i").css({visibility:"hidden"})}}})})});